@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM a owl:Class .
atm:Account a owl:Class .
atm:Bank a owl:Class .
atm:CashCard a owl:Class .
atm:Customer a owl:Class .

atm:ownsCard a owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:CashCard .

atm:belongsToBank a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Bank .

atm:hasAccount a owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:Account .

atm:cardIssuedBy a owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:Bank .

atm:validCashCard a owl:Class ;
    rdfs:subClassOf atm:CashCard .

atm:validPassword a owl:Class .

atm:validAccount a owl:Class ;
    rdfs:subClassOf atm:Account .

atm:BankComputer a owl:Class .

atm:sendAccountOk a owl:ObjectProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:ATM .

atm:BankComputer rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:sendAccountOk ;
    owl:someValuesFrom [
        a owl:Class ;
        owl:intersectionOf (
            atm:validCashCard
            atm:validPassword
            atm:validAccount
        )
    ]
] .
